import React, { Component } from 'react';
import User from './User';
// import './App.css';
import Styles from './App.module.css';
import cycle from './cycle.jpg'


export default class App extends Component { 
    state = {
        first_Name: 'enter name',
        last_Name: 'enter name'
    }
    changeFName =(e)=>{
        this.setState({First_name: e.target.value})
    }

    changeLName =(e)=>{
        this.setState({Last_name: e.target.value})
    }
    render() { 
        let style = true;
        return (
            <div>
                <form>
                    <label>
                        First_Name: <input type='text' value={this.state.First_Name} onChange={this.changeFName}/>
                    </label><br></br>
                    <label>
                        Last_Name: <input type='text' value={this.state.Last_Name} onChange={this.changeLName}/>
                    </label>
                </form>
            </div> 
        );                 
    }
}
